class Contact extends React.Component {
	render() {
  	return (
    	<div>
                <h2>Contact us</h2>
        <p>Write to us at 
        our <a href="abc@xyz.com">Email</a>.
        </p>
      </div>
    );
  }
}

export default Contact;
